$(document).ready(()=>{let a=new URLSearchParams(window.location.search);let b=a.get('m3u8');console.log(b);$.ajax({url:b,type:'GET'}).done((A,_,c)=>{console.log(A,_,c);let d=A.split('\n');let e=d.find(B=>B.endsWith('.m3u8'));console.log(e);let f=b.replace('index.m3u8','')+e;console.log(f);let g=videojs('vid1');g.src({src:f,type:'application/x-mpegURL',withCredentials:!0});g.play()}).fail((C,_b,_c)=>console.error(C,_b,_c))});